import React from 'react'
import { Link } from 'react-router-dom'

function Nav(){
    return (
        <nav> 
            <ul className="navList">
                <Link to={'gallery'}> <li>Gallery</li> </Link>

                <Link to={'draw'}><li>Erase!</li></Link>
            </ul>
        </nav>
    )
}
export default Nav
